package no.entur.android.nfc.external.acs.reader.command.acr1281;

public class CardInsertionCounters {

	private int iccCount;
	private int piccCount;

	public int getIccCount() {
		return iccCount;
	}

	public void setIccCount(int iccCount) {
		this.iccCount = iccCount;
	}

	public int getPiccCount() {
		return piccCount;
	}

	public void setPiccCount(int piccCount) {
		this.piccCount = piccCount;
	}

}
